import React from 'react';
import ReactDOM from 'react-dom';
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';
import './index.css';
import App from './App';
import Users from './users';
import Contact from './contact';
import FrontPage from './frontpage';
import * as serviceWorker from './serviceWorker';

const routing = (
  <Router>
    <div>
      <ul>
        <li>
          <Link to="/frontpage">home</Link>
        </li>
        <li>
          <Link to="/users">mine</Link>
        </li>
        <li>
          <Link to="/contact">archive</Link>
        </li>
        <li>
          <Link to="/contact">deploy</Link>
        </li>
        <li>
          <Link to="/contact">wallet</Link>
        </li>
        <li>
          <Link to="/contact">playground</Link>
        </li>
        <li>
          <Link to="/contact">show case</Link>
        </li>
        <li>
          <Link to="/contact">hackathon</Link>
        </li>
        <li>
          <Link to="/contact">blog</Link>
        </li>
        <li>
          <Link to="/contact">faq</Link>
        </li>
      </ul>
        <Route exact path="/frontpage" component={FrontPage} />
        <Route path="/users" component={Users} />
        <Route path="/contact" component={Contact} />
    </div>
  </Router>
)

ReactDOM.render(routing, document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
